import React, { Component } from "react";

class ModalDetalhesDoContrato extends React.Component {
  state = {
    contract: null
  };

  constructor(contract) {
    super();
    this.state.contract = contract.contract.contract;
  }

  render() {
    return (
      <div>
        <div className="container">
          <div className="modal fade" id="myModal" role="dialog">
            <div className="modal-dialog">
              <div className="modal-content">
                <div className="modal-body">
                  <div className="row justify-content-center border-bottom">
                    <div>
                      <p className="h4 text-secondary ml-4">
                        {this.state.contract.servicoModel.nomeServico}
                      </p>
                    </div>
                  </div>
                  <div className="row w-100 justify-content-left mt-4">
                    <div className="col-sm-6 mt-2">
                      <label className="h4 text-secondary mr-4"> Local: </label>
                      <label className="h5 text-primary"> Domicilio</label>
                    </div>
                    <div className="col-sm-6 mt-2">
                      <div className="">
                        <label className="h4 text-secondary mr-4">
                          {" "}
                          Categoria:{" "}
                        </label>
                        <label className="h5 text-primary"> Reformas </label>
                      </div>
                    </div>
                  </div>
                  <div className="row justify-content-left mt-4">
                    <label className="h4 text-secondary mr-4"> Datas: </label>
                    {Object.keys(this.state.contract.datas).map((e, i) => {
                      return (
                        <p className="h4 text-secondary ml-4">
                          {" "}
                          {this.state.contract.datas[i].dtAgendamento}
                        </p>
                      );
                    })}{" "}
                  </div>
                  <div className="modal-footer">
                    <button type="button" className="btn btn-primary w-24 mt-4">
                      Confirmar
                    </button>
                    <button
                      type="button"
                      className="btn btn-secondary w-50 mt-4"
                      data-dismiss="modal"
                    >
                      Fechar
                    </button>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ModalDetalhesDoContrato;
